import React from "react";
// nodejs library to set properties for components
import PropTypes from "prop-types";
// nodejs library that concatenates classes
import classNames from "classnames";
// @material-ui/core components
import withStyles from "@material-ui/core/styles/withStyles";

// @material-ui/icons

// core components
import Header from "components/Header/Header.jsx";
import HeaderLinks from "components/Header/HeaderLinks.jsx";
import Parallax from "components/Parallax/Parallax.jsx";

import landingPageStyle from "assets/jss/material-kit-react/views/landingPage.jsx";

// Sections for this page
import QuestionsSection from "./Sections/QuestionsSection.jsx";

const dashboardRoutes = [];


class QuestionsPage extends React.Component {
  constructor(props){
    super(props)
    this.state = {
      height: 100,
      step: 1, 
      deparment: null,
      number: null,
      town: null,
    }
  }

//Procedd next step
nextStep = () => {
  const { step } = this.state;
  this.setState({ step: step + 1 });
} 

//Go back previous step
prevStep = () => {
  const { step } = this.state;
  this.setState({ step: step -1 });
} 

  render() {
    const { classes, ...rest } = this.props;
    const { step } = this.state;
    return (
      <div>
        <Header
          color="transparent"
          routes={dashboardRoutes}
          brand="Memento"
          rightLinks={<HeaderLinks completed={true}/>}
          fixed
          changeColorOnScroll={{
            height: 400,
            color: "black"
          }}
          {...rest}
        />
         <Parallax filter small image={require("assets/img/hola.jpeg")}>
          <div className={classes.container}>
          </div>
        </Parallax>

        <div className={classNames(classes.main, classes.mainRaised)}>
          <div className={classes.container}>
            <QuestionsSection />
            <QuestionsSection/>
          </div>
        </div>
      </div>
    );
  }
}

QuestionsPage.propTypes = {
  classes: PropTypes.object
};

export default withStyles(landingPageStyle)(QuestionsPage);
